import React from "react";
import "./Counter.css";

const Counter = ({ number, color, onIncrement, onDecrement }) => {
  return (
    <div
      className="Counter"
      onClick={onIncrement}
      onContextMenu={e => {
        e.preventDefault();
        onDecrement;
      }}
    >
      {number}
    </div>
  );
};

Counter.defaultProps = {
  number: 0,
  color: "black"
};

export default Counter;
